    const login = () => {
        axios
            .post("/login", {
                email: "travis@angry-fly.com",
                password: "Password123"
            })
            .then((res) => {
                console.log(res)
            }
        )
    }

    const handleClick = () => {
        login()
    }

    return (
        <Button 
            variant="secondary" 
            onClick={handleClick}>
                Login
        </Button>
    )
}

export default LoginButton
